import React from 'react'
import Navbar from './Navbar'
import { Box } from "@material-ui/core"
import { makeStyles } from "@material-ui/core/styles";
import { Card, CardHeader, CardMedia, Grid, CardContent, CardActions, Button } from "@material-ui/core";
import { Typography } from "@material-ui/core"
import Avatar from '@material-ui/core/Avatar';
import cardData from './cardData'

const useStyles = makeStyles((theme) => ({

    skillCards: {
        maxWidth: 200,
    },
    // media: {
    //     height: 0,
    //     paddingTop: '70%', // 16:9
    // },
    avatar: {
        backgroundColor: "#27496d",
    },
    heading: {
        color: "#142850",
        padding: "2rem 0",
        textTransform: "uppercase"
    },
}));

const Portfolio = () => {
    const classes = useStyles();

    const bull = <span className={classes.bullet}>â€¢</span>;

    return (
        <Box component="div">
            <Navbar />
            <Typography className={classes.heading} variant="h4" align="center">
                Technical Skills
            </Typography>
            <Grid container>
                <Grid xs={12} sm={6} md={3}>
                    <Card className={classes.skillCards}>
                        <CardContent>
                            <Typography className={classes.title} color="textSecondary" gutterBottom>
                                Word of the Day</Typography>
                            <Typography variant="h5" component="h2">
                                be{bull}nev{bull}o{bull}lent</Typography>
                            <Typography className={classes.pos} color="textSecondary">
                                adjective</Typography>
                            <Typography variant="body2" component="p">
                                well meaning and kindly.
                            <br />
                                {'"a benevolent smile"'}
                            </Typography>
                        </CardContent>
                        <CardActions>
                            <Button size="small">Learn More</Button>
                        </CardActions>
                    </Card>
                </Grid>
            </Grid>
        </Box>
    )
}

export default Portfolio
